import { StatusBar } from "expo-status-bar";
import React from "react";
import DropdownMenu from 'react-native-dropdown-menu';
import { useForm } from "react-hook-form";

import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";

import Home from "./src/screen/HomeScreen";
import Loc from "./src/screen/locScreen";
import Loc_auto from "./src/screen/locScreen_auto";
import Loc_man from "./src/screen/locScreen_man";
import QuestionScreen from "./src/screen/QuestionScreen";
import QuestionScreenTwo from "./src/screen/QuestionScreen2";
import MapScreen from "./src/screen/MapScreen";

const Stack = createStackNavigator();

export default function App() {


  return (
    <NavigationContainer>
      <Stack.Navigator
        initialRouteName="Home">
        <Stack.Screen
          name="Home"
          component={Home}
        />
          <Stack.Screen
          name="Questions"
          component={QuestionScreen}
        />
           <Stack.Screen
          name="QuestionsTwo"
          component={QuestionScreenTwo}
        />
        <Stack.Screen
          name="Location"
          component={Loc}
        />
         <Stack.Screen
          name="LocAuto"
          component={Loc_auto}
        />
        <Stack.Screen
          name="LocMan"
          component={Loc_man}
        />
        <Stack.Screen
          name="MapSr"
          component={MapScreen}
        />
      </Stack.Navigator>
    </NavigationContainer>
  );
}
